import { css } from '@emotion/css';
import { Colors } from '../../styles/colors';
import { linkStyle, SubHeading } from '../../styles/fonts';

export const headerContainerStyle = css({
  height: '90px',
  width: '100vw',
  padding: '10px 50px',
  justifyContent: 'space-between',
  alignItems: 'center',
});

export const headerLinkContainerStyle = css({

})
export const headerLinkStyle = css(SubHeading.SH7, linkStyle, {
  marginRight: 12,
  color: Colors.White,
});
